  \"Ninepipe and Pablo National Wildlife Refuges Narrative report: Fiscal year 1974:
  July 1, 1973 to June 30, 1974\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:52:27.784197\",\n\t\"name\": \"ninepipe-and-pablo-national-wildlife-refuges-narrative-report-fiscal-year-1974-july-1-1-30\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ninepipe
  National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments and vegetation control. Resource management is outlined;
  topics include grazing. A progress report on field investigations and applied research
  is also provided. The public relations section discusses recreational uses and violations.
  N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
